def match_parens(lst):
    """
    Check if it is possible to concatenate two strings of parentheses in some order,
    that the resulting string will be good.

    Args:
        lst (list): A list of two strings, both strings consist of open parentheses '(' or close parentheses ')' only.

    Returns:
        str: 'Yes' if there's a way to make a good string, 'No' otherwise.
    """
    stack = []
    for s in lst:
        for c in s:
            if c == '(':
                stack.append(c)
            elif c == ')':
                if not stack:
                    return 'No'
                stack.pop()

    return 'Yes' if not stack else 'No'

def tri(n):
    """
    Returns a list of the first n + 1 numbers of the Tribonacci sequence.

    The Tribonacci sequence is defined by the recurrence:
    tri(1) = 3
    tri(n) = 1 + n / 2, if n is even.
    tri(n) =  tri(n - 1) + tri(n - 2) + tri(n + 1), if n is odd.

    Args:
        n (int): A non-negative integer.

    Returns:
        list: A list of the first n + 1 numbers of the Tribonacci sequence.
    """
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]
    else:
        sequence = [1, 3, 2]
        for i in range(3, n + 1):
            if i % 2 == 0:
                sequence.append(1 + i / 2)
            else:
                sequence.append(sequence[i - 2] + sequence[i - 3] + sequence[i - 1])
        return sequence

